import React from "react";
import { Link, useNavigate } from "react-router-dom";

function Credits() {
  return (
    <div>
      <h2>Credits</h2>


      <nav>
        <ul>
          <li>
            <Link to="/userProfile">Back to Profile</Link>
          </li>
        </ul>
      </nav>
    </div>
  );
}

export default Credits;
